import { useState } from "react";

export default function Login() {

	const [phoneNumber, setPhoneNumber] = useState();

	const handlePhoneNumber = (e) => {
		const inputPhoneNumber = e.target.value.replace(/\D/g, ''); // Remove non-digit characters
		let formattedPhoneNumber = '+998';

		if (inputPhoneNumber.length >= 2) {
			formattedPhoneNumber += ` (${inputPhoneNumber.slice(0, 2)})`;

			if (inputPhoneNumber.length >= 5) {
			  formattedPhoneNumber += ` - ${inputPhoneNumber.slice(2, 5)}`;

			  if (inputPhoneNumber.length >= 8) {
				formattedPhoneNumber += ` - ${inputPhoneNumber.slice(5, 7)}`;

				if (inputPhoneNumber.length >= 10) {
				  formattedPhoneNumber += ` - ${inputPhoneNumber.slice(7, 9)}`;
				}
			  }
			}
		  }

		setPhoneNumber(formattedPhoneNumber);
	};

    return (
        <div class="container-fluid">
		<div class="row">
			<div class="col-lg-6 col-md-6 d-none d-md-block infinity-image-container"></div>

			<div class="col-lg-6 col-md-6 infinity-form-container">
				<div class="col-lg-9 col-md-12 col-sm-8 col-xs-12 infinity-form">
					<div class="text-center mb-3 mt-5">
						{/* <img src="logo.png" width="150px"> */}
					</div>
					<div class="text-center mb-4">
		        <h4>Tizimga kirish</h4>
		      </div>
					<form class="px-3">
						<div class="form-input">
							<span><i class="fa fa-envelope"></i></span>
							<input type="text"
							value={phoneNumber}
      onChange={handleChange} type="email" name="" placeholder="Email Address" tabindex="10"required />
						</div>
						<div class="form-input">
							<span><i class="fa fa-lock"></i></span>
							<input type="password" name="" placeholder="Parol" required />
						</div>
						<div class="row mb-3">
		  	      <div class="col-auto d-flex align-items-center">
				        <div class="custom-control custom-checkbox">
				          <input type="checkbox" class="custom-control-input" id="cb1" />
				         	<label class="custom-control-label" for="cb1">Remember me</label>
				        </div>
				      </div>
				    </div>

				    <div class="mb-3"> 
							<button type="submit" class="btn btn-block">Login</button>
						</div>
						<div class="text-right">
			        <a href="reset.html" class="forget-link">Forgot password?</a>
			      </div>

						<div class="text-center mb-2">
		         	<div class="text-center mb-3" style={{color: '#777'}}>or login with</div>

		         	<a href="" class="btn btn-social btn-facebook">facebook</a>

							<a href="" class="btn btn-social btn-google">google</a>

							<a href="" class="btn btn-social btn-twitter">twitter</a>
						</div>

						<div class="text-center mb-5" style={{color: '#777'}}>Don't have an account? 
							<a class="register-link" href="register.html">Register here</a>
	        	</div>
					</form>
				</div>
			</div>
		</div>
	</div>
    );
}
